import { useState } from "react";

const Button = function () {
  return <button>+</button>;
};

const Counter = function ({ counter }) {
  const [count, setCount] = useState(0);
};

function App() {
  return (
    <div>
      <Button />
      <Counter counter={counter} />
    </div>
  );
}

export default App;
